import React, { useState } from 'react';
import Character from './assets/Character';
import './App.css';
const App = () => {
const [characters, setCharacters] = useState([
    { id: 1, name: 'SpongeBob SquarePants', description: 'A cheerful sea sponge who works at the Krusty Krab.', image: 'data:image/jpeg;base64,' },
    { id: 2, name: 'Patrick Star', description: 'A pink starfish and SpongeBob\'s best friend.', image: 'data:image/jpeg;base64,' },
    { id: 3, name: 'Squidward Tentacles', description: 'A grumpy octopus who plays the clarinet.', image: 'data:image/jpeg;base64,' },
    { id: 4, name: 'Mr. Krabs', description: 'A greedy crab and owner of the Krusty Krab.', image: 'data:image/jpeg;base64,' },
    { id: 5, name: 'Sandy Cheeks', description: 'A squirrel from Texas with a love for karate.', image: 'data:image/jpeg;base64,' },
  ]);
  const updateCharacter = (id, updatedChar) => {
    setCharacters(characters.map(char => char.id === id ? updatedChar : char));
  };

  const deleteCharacter = (id) => {
    setCharacters(characters.filter(char => char.id !== id));
  };

  return (
    <div className="dashboard">
      {characters.map((char) => (
        <Character
          key={char.id}
          id={char.id}
          name={char.name}
          description={char.description}
          image={char.image}
          updateCharacter={updateCharacter}
          deleteCharacter={deleteCharacter}
        />
      ))}
    </div>
  );
};

export default App;